Reports string concatenations where one of the arguments is the empty string. Such a concatenation is unnecessary. Sometimes, it's used as an idiom for converting non-`String` objects or primitives into `String`s, but in this case, it's clearer to use a method like `String.valueOf`.


A quick-fix is suggested to simplify the concatenation.

**Example:**


      void foo(int x, int y) {
        String s = "" + x + " ; " + y;
      }

After the quick-fix is applied:


      void foo(int x, int y) {
        String s = x + " ; " + y;
      }


